select laborerId,1,1,{ts '2015-01-01 00:00:00.0'},{ts '2015-01-01 00:00:00.0'} from laborer WHERE laborerId NOT IN (412) -- deja uno afuera para hacer pruebas 
AND NOT EXISTS(SELECT 1 FROM laborer_constructionsite lcs WHERE lcs.laborerId = laborerId AND lcs.active = 1 ); -- y solo lo agrega si no tiene un contrato activo 

-- agrega los contratos y trabajos
MERGE INTO contract(contractId,active,contract_description,job,job_code,name,startdate,step,laborer_constructionsiteId)
KEY(contractId)
SELECT rownum,1,'contrato de ${laborer.fullname} para el trabajo ${lcs.job} en la etapa ${lcs.step}',1,rownum,L.firstname,sysdate,'Obra Gruesa',laborer_constructionsiteId 
FROM laborer_constructionsite LC JOIN laborer L ON LC.laborerId = L.laborerId
WHERE NOT EXISTS (select 1 FROM contract WHERE laborer_constructionsiteId = LC.laborer_constructionsiteId);

